import React from "react";
import Show from "./Show";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="Home">
      <Link className="logo" to="/">
        <h3>Q.KIT</h3>
      </Link>
      <Show />
    </div>
  );
};

export default Home;
